import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any product card to appear (use .product-card class)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot of product grid area
    const gridShot = path.join(screenshotsDir, 'step_2_products_grid.png');
    const grid = await page.$('.products-grid');
    if (grid) {
      await grid.screenshot({ path: gridShot });
      screenshots.push(gridShot);
    }

    // Extract all visible product prices using multiple selector strategies
    // 1. Try .product-price inside .product-card
    // 2. Fallback: Any element with class containing 'price' and a $ sign
    // 3. Fallback: XPath for $-prefixed text

    // Strategy 1: .product-card .product-price
    let prices = await page.$$eval('.product-card .product-price', els =>
      els.map(el => el.textContent)
    );

    // If not found, try more generic selectors
    if (!prices || prices.length === 0) {
      prices = await page.$$eval('[class*=price]', els =>
        els
          .map(el => el.textContent)
          .filter(txt => /\$\d/.test(txt))
      );
    }

    // If still not found, use XPath for $-prefixed text
    if (!prices || prices.length === 0) {
      const priceHandles = await page.$x("//*[contains(text(), '$')]");
      prices = [];
      for (const handle of priceHandles) {
        const txt = await handle.textContent();
        if (/\$\d/.test(txt)) prices.push(txt);
      }
    }

    // Clean up prices (extract only $amount, ignore original/discount if present)
    const extractedPrices = [];
    for (const raw of prices) {
      // Match all $amounts in the string
      const matches = raw.match(/\$\d[\d,]*(\.\d{2})?/g);
      if (matches) {
        extractedPrices.push(...matches);
      }
    }

    // Remove duplicates and sort
    const uniquePrices = Array.from(new Set(extractedPrices));

    // Take screenshot of the first product card (for verification)
    const firstCard = await page.$('.product-card');
    if (firstCard) {
      const cardShot = path.join(screenshotsDir, 'step_3_first_product_card.png');
      await firstCard.screenshot({ path: cardShot });
      screenshots.push(cardShot);
    }

    return {
      success: true,
      action: "Extracted all visible product prices from the page using multiple selector strategies",
      extractedData: {
        productPrices: uniquePrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
